    int version;

    glGetString = (PFNGLGETSTRINGPROC) load(userptr, "glGetString");
    if(glGetString == NULL) return 0;
    if(glGetString(GL_VERSION) == NULL) return 0;
    version = glad_gl_find_core_gl();

